import Axios from 'axios'
import React ,{ useState, useEffect, useMemo }from 'react'
import ReactTable from 'react-table'
//import { COLUMNS } from './ComponentSearch/DataColumns'

function Search() {
    const [data, setData] = useState('')
    useEffect(() => {
        fetch('http://localhost:3001/api/get')
        .then((response) => response.json())
        .then((json) => setData(json))
    },[]);
    
    const COLUMNS = [
        {
            Header: 'Part Code',
            acessor: 'PartCode'
        },
        {
            Header: 'Brand',
            acessor: 'Brand'
        },
        {
            Header: 'Location',
            acessor: 'Location_at'
        },
        {
            Header: 'Description',
            acessor: 'Description'
        },
        {
            Header: 'Value',
            acessor: 'Values_number'
        },
        {
            Header: 'Date',
            acessor: 'Date'
        },
    
    ]

    return (
        <div>
            <ReactTable
                columns={COLUMNS}>

            </ReactTable>
        </div>
    )
}

export default Search
